INSERT INTO `pelicula` (`id`, `title`, `description`, `time`, `year`, `director`, `category`, `imagen`, `ruta_imagen`) VALUES
(0, 'Avengers: Endgame / Vengadores 4', 'Tras los sucesos de «Vengadores: Infinity War», los superhéroes que sobrevivieron a Thanos se reunen para poner en práctica un plan definitivo que podría acabar con el villano definitivamente. No saben si funcionará, pero es su única oportunidad de intentarlo. Cuarta entrega de la saga «Vengadores»', '03:02:00', 2019, 'Anthony Russo, Chris Castaldi, Edward Catley, Joe ', 'Acción Aventura Fantasía', , 'imagenes/qwLbQSeFy6ht8skBtao7lAZjsDo.jpg');
INSERT INTO `pelicula` (`id`, `title`, `description`, `time`, `year`, `director`, `category`, `imagen`, `ruta_imagen`) VALUES
(1, 'Radioflash', 'Cuando un ataque nuclear provoca un pulso electromagnético que corta toda la energía, el agua y la comunicación a todo el oeste de los Estados Unidos, Reese se ve inmersa en una lucha demasiado real para sobrevivir. Mientras el pandemónium se apodera de su ciudad, Reese y su padre emprenden un viaje desesperado en busca de seguridad: un peligroso viaje a través de un mundo enloquecido donde cada encuentro con un extraño podría ser el último.', '01:42:00', 2019, 'Benjamin McPherson', 'Suspenso', , 'imagenes/z7RNOII2gXkZugOf7TjsISoLYRl.jpg');
INSERT INTO `pelicula` (`id`, `title`, `description`, `time`, `year`, `director`, `category`, `imagen`, `ruta_imagen`) VALUES
(2, 'Jeepers Creepers: Reborn', 'El Horror Hound festival celebra su primer evento en Luisiana, donde atrae a cientos de fanes del terror; entre ellos se encuentra Laine que, obligada a asistir por Chase, su novio, comienza a experimentar premoniciones inexplicables y visiones inquietantes relacionadas con el pasado de la ciudad y con El Creeper. A medida que avanza el festival y el entretenimiento empapado de sangre se convierte en un frenesí, Laine cree que algo sobrenatural ha sido convocado y que ella está en el centro de todo', '01:28:00', 2022, 'Timo Vuorensola', 'Misterio Terror Thriller', , 'imagenes/pyFyhcXx4kNnLbzEY5z5fc3RehQ.jpg'),
(3, 'Yo me encargo de la cerveza', 'Nueva York, 1967. Para demostrar su apoyo a sus colegas del barrio que están combatiendo en Vietnam, Chickie Donohue (Zac Efron) decide viajar a la primera línea del frente para llevar a los soldados unas latas de su cerveza norteamericana favorita. Lo que empieza como un viaje repleto de buenas intenciones se convierte rápidamente en una aventura iniciática cuando Chickie se enfrenta a la realidad de esa controvertida guerra, y cuando el reencuentro con sus amigos de la infancia le muestra las complejidades y responsabilidades de la vida adulta.', '02:06:00', 2022, 'Peter Farrelly', 'Aventura Comedia, Drama', , 'imagenes/ebZLD9PD1YGU15QoY1PfVOj2x1n.jpg');
INSERT INTO `pelicula` (`id`, `title`, `description`, `time`, `year`, `director`, `category`, `imagen`, `ruta_imagen`) VALUES
(4, 'El teléfono del señor Harrigan', 'Un chico entabla amistad con un anciano y huraño multimillonario y descubre que es capaz de comunicarse con él después de muerto gracias al iPhone con el que fue enterrado. Basada en el relato corto de Stephen King.', '01:46:00', 2022, 'John Lee Hancock', 'Terror', , 'imagenes/aERrzPJyUYAhmbies50dMz21W4u.jpg'),
(5, 'Atenea', 'Horas después de la trágica muerte de su hermano menor en circunstancias inexplicables, la vida de tres hermanos se ve sumida en el caos.', '01:37:00', 2022, 'Amin Harfouch, Emilie Justin, Joseph Rapp, Lola Be', 'Acción Drama Thriller', , 'imagenes/uponqptyKtBsJuODqmxoronFd8P.jpg');
INSERT INTO `pelicula` (`id`, `title`, `description`, `time`, `year`, `director`, `category`, `imagen`, `ruta_imagen`) VALUES
(6, 'Samaritan', 'La película, protagonizada por Stallone en el papel del superhéroe, seguirá los pasos de un joven que descubre que el superhéroe al que todos admiraban, y al que creían muerto, podría seguir vivo…', '01:39:00', 2022, 'Julius Avery', 'Acción Drama Fantasía', , 'imagenes/zgH8Ej50n2cvJCMJrxd4twEwSqz.jpg'),
(7, 'Depredador: La Presa', 'Ambientada hace 300 años en la Nación Comanche. Naru es una joven guerrera, feroz y altamente hábil, que se crió a la sombra de algunos de los cazadores más legendarios que deambulan por las Grandes Llanuras. Cuando el peligro amenaza su campamento, se dispone a proteger a su gente. La presa a la que acecha y, en última instancia, se enfrenta, resulta ser un depredador alienígena evolucionado con un arsenal técnicamente avanzado, lo que deriva en un enfrentamiento cruel y aterrador entre los dos adversarios.', '01:40:00', 2022, 'Bronwyn Johansen, Casey Chipera, Dan Trachtenberg,', 'Acción Drama Terror', , 'imagenes/cv6zBbPfP0MMxgMdve95YrIIQwq-200x300.jpg');
INSERT INTO `pelicula` (`id`, `title`, `description`, `time`, `year`, `director`, `category`, `imagen`, `ruta_imagen`) VALUES
(8, 'Shut In', 'Una joven madre soltera es cautiva junto con sus dos hijos por un ex violento y debe planear su escape antes de que sea demasiado tarde.', '01:30:00', 2022, 'D.J. Caruso', 'Drama Terror Thriller', , 'imagenes/b5ug4LyLQFeR6azAJyIPBQz5ur9.jpg'),
(9, 'Alcarras', 'El abuelo ha dejado de hablar, pero nadie de la extensa familia Solé sabe la razón. Como cada verano, en Alcarràs, una pequeña localidad rural de Cataluña, la familia cultiva una gran extensión de melocotoneros.', '02:00:00', 2022, 'Carla Simón', 'Aventura Drama', , 'imagenes/uQYR7MNLtLWN1WdbITOqzA28eH9.jpg'),
(10, 'A 47 metros 2', 'Esta secuela de «A 47 Metros» traslada la mortífera acción de los tiburones desde México a Brasil, y seguirá a un grupo de chicas en busca de aventuras en la costa de Recife. Con la esperanza de salir del rutinario sendero turístico, las chicas escuchan algo acerca de unas ruinas submarinas ocultas, pero descubren que bajo las olas turquesas su Atlantis secreta no está completamente deshabitada.', '01:29:00', 2019, 'Johannes Roberts', 'Aventura Drama Terror', , 'imagenes/tWZ9tgEEpeku0hBjjHLBPHd0jXT.jpg');
INSERT INTO `pelicula` (`id`, `title`, `description`, `time`, `year`, `director`, `category`, `imagen`, `ruta_imagen`) VALUES
(11, 'Wild Card (Jugada salvaje)', 'Trata sobre un ex adicto al juego que se gana la vida como guardaespaldas en el mundillo de las apuestas; este peculiar protector, que no usa armas de fuego, se mete en problemas cuando defiende a una vieja amiga que es brutalmente golpeada por un importante mafioso.', '01:32:00', 2015, 'Mary Frances Eglin, Simon West', 'Acción Crimen Drama Thriller', , 'imagenes/6j8F7zOwBxpJP5AlVbe1FWx1Cm7.jpg'),
(12, 'La Mujer Rey', 'Una epopeya histórica inspirada en los hechos reales que sucedieron en el Reino de Dahomey, uno de los estados más poderosos de África en los siglos XVIII y XIX. La historia sigue a Nanisca (Davis), general de la unidad militar exclusivamente femenina y a Nawi (Mbedu), una recluta ambiciosa. Juntas lucharon contra enemigos que violaron su honor, esclavizaron a su gente y amenazaron con destruir todo por lo que habían vivido.', '02:15:00', 2022, 'Gina Prince-Bythewood', 'Acción Drama Historia', , 'imagenes/g7H3cg6aM11JOdlOLqaUp4BmMvM.jpg');

